import React, {useEffect,useState} from 'react'
import {Link, useParams} from "react-router-dom"


export default function Home(){

    const [deck, setDeck] = useState({});

    useEffect(() => {
      async function loadDeck() {
        const response = await fetch(
          'http://localhost:5000/decks/'
        );
        const deckFromAPI = await response.json();
        setDeck(deckFromAPI);
      }
      loadDeck();
    }, []);

    return(
        <div>
        <Link to="/decks/new"><button type="button" class="btn btn-secondary">Create Deck +</button></Link>

        <div class="card w-75">
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
    <Link to="/decks/:deckId" className="btn btn-secondary">View</Link>
  </div>
</div>
        </div>

    )
}
